import math

def sin_square(x):
    return math.sin(math.radians(x)) ** 2

def cos_square(x):
    return math.cos(math.radians(x)) ** 2

def sin_cos(x):
    return math.sin(math.radians(x)) * math.cos(math.radians(x))

def is_triangle(a, b, c):
    return (a ** 2 + b ** 2) == c ** 2

def is_not_triangle(a, b, c):
    return not is_triangle(a, b, c)

def is_not_triangle_probability(x):
    return is_not_triangle(sin_square(x), cos_square(x), sin_cos(x))

def find_m_n(p):
    m = 1
    n = 1
    while True:
        if is_not_triangle_probability(math.degrees(math.atan(m / n))) < p:
            n += 1
        else:
            m += 1
        if m + n >= 1000:
            break
    return m + n

print(find_m_n(0.5))
